import React from 'react';
import './Footer.css';

const Footer = () => {
    return(
        <footer className="footer">
            <div className='container'>
                <p className='text-muted'>My Website &#169; { new Date().getFullYear() }</p>
            </div>
        </footer>
    );
}

export default Footer
